import React from "react";
import { Routes, Route, Navigate } from "react-router-dom";
import Queue from "./pages/Queue";

export default function App() {
  return (
    <Routes>
      <Route path="/" element={<Navigate to="/queue" />} />
      <Route path="/queue" element={<Queue />} />
    </Routes>
  );
}
